import React from 'react';

var DataTable = (props) => {
 return (
   <table className ="table">
     <thead id  ="headers">
       <tr>
         {
          props.cols.map((d, i) =>
           <th key = {"header" + i}> {d} </th>
           )
        }
       </tr>
     </thead>
     <tbody>
       {
         props.rows.map((row, i) =>
           <tr key = {"row"+i}>
           {
             props.cols.map((col, i) =>
               <td key = {col}> row[col] </td>
               )
           }

           </tr>
           )
       }
     </tbody>

   </table>
   )
}

export default DataTable
